import { Component } from '@angular/core';

@Component({
  templateUrl: './stats.component.html',
})
export class StatsComponent {}
<h1>Statistics Page</h1>
<div class="card-container">
    <div class="content" role="main">
        <div class="card">
            <a class="card" href="{{ url_for('daily_visits') }}">Daily Visits</a>
            <a class="card" href="{{ url_for('monthly_visits') }}">Monthly Visits</a>
            <a class="card" href="{{ url_for('database_storage') }}">Database Storage</a>
            <a class="card" href="{{ url_for('upload_history') }}">Upload History</a>
        </div>
    </div>
</div>
